import React from "react";
import {
  Switch,
  Route,
} from "react-router-dom";
import Home from "../Content/Home";

function RouterURL({CourseList , removeCourse , addCourse}) {
    return ( 
        <Switch>
            <Route exact path="/">
                <Content CourseList = {CourseList} removeCourse = {removeCourse} addCourse = {addCourse}/>
            </Route>
            <Route exact path="/">
                <Content CourseList = {CourseList} removeCourse = {removeCourse} addCourse = {addCourse}/>
            </Route>
        </Switch>
    );
}

export default RouterURL;
